        "rek_formatted_abstract":"<strong>Review question<\/strong><br \/>We reviewed the evidence about the effect of diaries, in comparison to no diary, on recovery in people recuperating from critical illness,&nbsp;and their caregivers and families.<br \/><br \/><strong>Background<\/strong><br \/>People who have been critically ill experience significant physical and psychological problems during recovery. Diaries outlining a&nbsp;person&rsquo;s intensive care unit (ICU) experience have been suggested as something that may be effective in helping survivors and their&nbsp;family members recover psychological function.<br \/><br \/><strong>Study characteristics<\/strong><br \/>The evidence is current to January 2014. We identified three eligible studies; two describing 358 ICU patients, and one describing 30&nbsp;relatives of ICU patients. These were included in the review. The study involving relatives of ICU patients was a substudy of family&nbsp;members from one of the ICU patient studies. All people included in the studies were adults based in Europe and the UK, with a mixed&nbsp;severity of critical illness requiring admission to an ICU.<br \/><br \/><strong>Key results<\/strong><br \/>We found no studies that had reported the risk of post-traumatic stress disorder in patients recovering from admission to ICU using a&nbsp;structured clinical interview.<br \/>The other primary outcome measures of anxiety and depression were described in one study of 36 patients. In this study no clear&nbsp;evidence of a difference was seen in anxiety and depression when patient diaries were used for people recovering from ICU admission",
